// SPDX-License-Identifier: MIT
pragma solidity 0.8.30;

interface IBEP20 {
    function balanceOf(address account) external view returns (uint256);
}

interface ISwapRouter {
    function factory() external pure returns (address);
}

interface ISwapFactory {
    function createPair(address tokenA, address tokenB) external returns (address pair);
    function feeTo() external view returns (address);
}

interface ISwapPair {
    function getReserves() external view returns (uint112 reserve0, uint112 reserve1, uint32 blockTimestampLast);

    function totalSupply() external view returns (uint);

    function kLast() external view returns (uint);

    function sync() external;
}

interface IAddressManager {
    function getMaxGasPrice() external view returns (uint256);
    function getTetherAddress() external view returns (address);
    function setWoohooAddress(address woohooAddress) external;
    function getRouterAddress() external view returns (address);
    function getNftRecipientAddress() external view returns (address);
    function getProjecterAddress() external view returns (address);
    function getStakeManagerAddress() external view returns (address);
    function getFundManagerAddress() external view returns (address);
}

interface IStakeManager {
    function addDividendAmount(uint256 amount) external;
}

contract BEP20Token {

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);

    mapping(address => uint256) public _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    string private _name;
    string private _symbol;
    uint8 private _decimals;

    uint256 private _tTotal;
    address private _uPair;

    address private deadWallet = 0x000000000000000000000000000000000000dEaD;

    uint256 private constant MAX = ~uint256(0);

    IAddressManager private _addressManager;

    mapping (address => uint256) private _addressLastTxTimeMap;

    mapping (address => bool) private _inSwapMap;
    modifier lockForSwap (address _user) {
        require(!_inSwapMap[_user], "user is in swap");
        _inSwapMap[_user] = true;
        _;
        _inSwapMap[_user] = false;
    }

    modifier lockMaxGasPrice {
        require(tx.gasprice <= _addressManager.getMaxGasPrice(), "gas price is too large");
        _;
    }

    constructor (address am, string memory __name, string memory __symbol, uint8 __decimals, uint256 __total) {
        _addressManager = IAddressManager(am);
        address usdtAddress = _addressManager.getTetherAddress();
        require(address(this) > usdtAddress);

        _name = __name;
        _symbol = __symbol;
        _decimals = __decimals;

        ISwapRouter _swapRouter = ISwapRouter(_addressManager.getRouterAddress());
        ISwapFactory swapFactory = ISwapFactory(_swapRouter.factory());
        _uPair = swapFactory.createPair(usdtAddress, address(this));

        uint256 tokenUnit = 10 ** __decimals;

        _tTotal = __total * tokenUnit;

        _balances[msg.sender] = _tTotal;
        emit Transfer(address(0), msg.sender, _tTotal);

        _addressManager.setWoohooAddress(address(this));
    }

    function symbol() external view returns (string memory) {
        return _symbol;
    }

    function name() external view returns (string memory) {
        return _name;
    }

    function decimals() external view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view returns (uint256) {
        return _tTotal;
    }

    function balanceOf(address account) public view returns (uint256) {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount) public returns (bool) {
        _transfer(msg.sender, recipient, amount);
        return true;
    }

    function allowance(address owner, address spender) public view returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public returns (bool) {
        _approve(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public returns (bool) {
        _transfer(sender, recipient, amount);
        if (_allowances[sender][msg.sender] != MAX) {
            _allowances[sender][msg.sender] = _allowances[sender][msg.sender] - amount;
        }
        return true;
    }

    function _approve(address owner, address spender, uint256 amount) private {
        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) private {
        uint256 balance = balanceOf(from);
        require(balance >= amount, "not enough amount");

        address usdtAddress = _addressManager.getTetherAddress();

        if (from == _uPair) {
            bool isRemoveLp = _isRemoveLiquidityU(usdtAddress, _uPair);
            if (isRemoveLp) {
                _takeTransfer(from, to, amount);
            } else {// buy
                _processBuy(from, to, amount);
            }
        } else if (to == _uPair) {
            bool isAddLP = _isAddLiquidityU(usdtAddress, _uPair);
            if (isAddLP) {
                _takeTransfer(from, to, amount);
            } else {// sell
                if (amount >= balance) amount = balance * 99 / 100;
                _processSell(from, to, amount);
            }
        } else {
            _takeTransfer(from, to, amount);
        }
    }

    function _processBuy(address from, address to, uint256 amount) internal lockForSwap(to) lockMaxGasPrice {
        require(block.timestamp >= _addressLastTxTimeMap[to] + 10, "too fast");
        _takeTransfer(from, _addressManager.getNftRecipientAddress(), amount * 3 / 100);
        _takeTransfer(from, _addressManager.getProjecterAddress(), amount * 3 / 100);
        _takeTransfer(from, _addressManager.getFundManagerAddress(), amount * 3 / 100);
        IStakeManager(_addressManager.getStakeManagerAddress()).addDividendAmount(amount * 3 / 100);
        _takeTransfer(from, to, amount * 91 / 100);
        _addressLastTxTimeMap[to] = block.timestamp;
    }

    function _processSell(address from, address to, uint256 amount) internal lockForSwap(from) lockMaxGasPrice {
        require(block.timestamp >= _addressLastTxTimeMap[from] + 10, "too fast");
        _takeTransfer(from, _addressManager.getNftRecipientAddress(), amount * 3 / 100);
        _takeTransfer(from, deadWallet, amount * 3 / 100);
        _takeTransfer(from, _addressManager.getFundManagerAddress(), amount * 3 / 100);
        IStakeManager(_addressManager.getStakeManagerAddress()).addDividendAmount(amount * 3 / 100);
        _takeTransfer(from, to, amount * 91 / 100);
        _addressLastTxTimeMap[from] = block.timestamp;
    }

    function _isAddLiquidityU(address usdtAddress, address lpAddress) internal view returns (bool isAdd){
        ISwapPair uPair = ISwapPair(lpAddress);
        (uint r0,uint256 r1,) = uPair.getReserves();

        address tokenOther = usdtAddress;
        uint256 r;
        if (tokenOther < address(this)) {
            r = r0;
        } else {
            r = r1;
        }

        uint bal = IBEP20(tokenOther).balanceOf(address(uPair));
        isAdd = bal > r;
    }

    function _isRemoveLiquidityU(address usdtAddress, address lpAddress) internal view returns (bool isRemove){
        ISwapPair uPair = ISwapPair(lpAddress);
        (uint r0,uint256 r1,) = uPair.getReserves();

        address tokenOther = usdtAddress;
        uint256 r;
        if (tokenOther < address(this)) {
            r = r0;
        } else {
            r = r1;
        }

        uint bal = IBEP20(tokenOther).balanceOf(address(uPair));
        isRemove = r >= bal;
    }

    function _takeTransfer(
        address sender,
        address to,
        uint256 tAmount
    ) private {
        _balances[sender] = _balances[sender] - tAmount;
        _balances[to] = _balances[to] + tAmount;
        emit Transfer(sender, to, tAmount);
    }

}

